import React from 'react'
import "./Portfoli.css"
import {swiper, Swiperslide} from "swiper/react"
// import window from "../../img/window.png";
import algo from "../../img/algo.jpg";
import ai from "../../img/ai.jpg";
import face from "../../img/face.jpg";
import theft from "../../img/theft.png"
import "swiper/css"


export const Portfolio = () => {
  return (
    <div className="portfolio">
        {/* heading */}
        <span>Recent Project</span>
        <span>Portfolio</span>

        {/* slider */}
        <swiper>
            <swiperslide>
                <img src={theft} alt=""/> 
            </swiperslide>
            <swiperslide>
                <img src={ai} alt=""/> 
            </swiperslide>
            {/* <swiperslide>
                <img src={face} alt=""/> 
            </swiperslide> */}
            <swiperslide>
                <img src={algo} alt=""/> 
            </swiperslide>
            

        </swiper>
    </div>
     )
}
